import styled from "styled-components";

const NewsBg = styled.section`
  position: relative;
  height: 500px;
`

const NewsTop = styled.div`
  background: #222222;

  img{
    margin: 0 0 0 auto;
    width: 50%;
  }
`

const NewsDown = styled.div`
  background: #f3f3f3;
`

const News = () => {
    return(
        <NewsBg>
            <NewsTop>
                <img src='./img/NewsTop.png' alt='News' />
            </NewsTop>
            <NewsDown>
                <img src='./img/NewsDown.png' alt='News' />
            </NewsDown>
        </NewsBg>
    );
}

export default News;
